import React from 'react';
import Footer from '../Footer/'

function Chart() {

    return (
        <div>

            <div class="container">
                <button class="button" id='line'>Line</button>
                <button class="button" id='bar'>Bar</button>
                <canvas class="" id="myChart"></canvas>
            </div> <br></br>
            <Footer/>
        </div>
    )
}

export default Chart;
